import React from "react";
import Expert from "../Expert/Expert";



const Experts = () => {
  return (
    <div className="container">
      <h2 className="text-primary">These are ExpetSSS</h2>
      <br />

      <div className="row">
        {experts.map((expert) => (
          <Expert key={expert.name} expert={expert}></Expert>
        ))}
      </div>
    </div>
  );
};

export default Experts;
